import React, { Component } from 'react'
import ActionButton from "./components/ActionButton"
import './App.scss';




class App extends Component {
  constructor() {
    super()
    this.state = {}
  }

  componentDidMount() {}


  render() {
    return (
      <div className="app h-100">

        <ActionButton action={this.togglePopup} text="SEE MORE" specId="see-more"/>
      </div>
    )
  }
}

export default App
